import React from 'react'

import './Times.css'

export default function Times(props) {
    const {handleTime, active} = props;
    const bookingSlots = ["06:00 - 09:00", "09:00 - 12:00", "12:00 - 15:00", "15:00 - 18:00"];

    return (
        <div className="time-slots-container">
            {bookingSlots.map((t, i) =>
                <button
                    key={i}
                    className={active ? "active" : ""}
                    variant='outlined'
                    onClick={() => handleTime(t)}>
                    {t}
                </button>
            )}
        </div>
    )
}
